import './CategoryField.css'

function CategoryField(props){
    let listItems = props.categories.map((val)=>{
        return(
        <li className="nav-item" key= {val}>
            <a className="nav-link" href={"#"+val}>{val}</a>
        </li>);
    });
    return(
        <nav className="navbar navbar-secondary bg-dark px-3">
            <ul className="nav nav-pills">
                {listItems}
            </ul>
        </nav>
    )
}

export default CategoryField;
